import React, { useState } from "react";
import Input from "../input/Input";

const Registartion = () =>{
    const [email, setEmail] = useState("")
    const [password, setPassword] = useState("")
    const [repeatPassword, setRepeatPassword] = useState("")
    return(
        <div className="registartion">
            <div className="navbar_login">email</div>
            <Input value={email} setValue = {setEmail} type="text" />

            <div className="navbar_registartion">password</div>
            <Input value={password} setValue = {setPassword} type="password"/>

            <div className="navbar_registartion">repeat password</div>
            <Input type="password" value={repeatPassword} setValue = {setRepeatPassword} />

            <button className="sinup" onClick={()=>{
                if(password !== repeatPassword){
                    console.log("!!!!!!!")
                }
            }}>Sing up</button>
        </div>
    )
}

export default Registartion;
